// import HorizentalLine from "./horizentalLine.js"
import "./mypageSel.css"

function myPageSel(){
return (
    <div> {/* <nav> 요소는 문서의 부분 중 현재 페이지 내, 또는 다른 페이지로의 링크를 보여주는 구획을 나타냅니다 */}
        <div> {/* 마이페이지 윗부분 */}
            
                <div className = "mypage-up">
                <h1><a className = "mypage-font">MyPage</a></h1>
                </div>
                
            
                <ul className = "componentbox">
                    <li className = "componentbox-sub">
                        <a className = "componentbox-info" >기본정보</a>
                    </li>
                    <li className = "componentbox-sub">
                        <a className = "componentbox-info" >영양제 취향 정보</a>
                    </li>
                    <li className = "componentbox-sub">
                        <a className = "componentbox-info" >나의 약장</a>
                    </li>
                    <li className = "componentbox-sub">
                        <a className = "componentbox-info" >회원탈퇴</a>
                    </li>
                </ul>
            
            
        </div>
    


        <div> {/* 마이페이지 아래부분 */}

        </div>
    </div>
    );
}

export default myPageSel;
